  Id: 1,
  Zdjecie: "profile.jpg",
  Nazwa: "Kuroneko",
  Wpis: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer quis justo malesuada, euismod sem nec, porta risus. Proin rutrum arcu non auctor accumsan. Ut ultricies elit eget ex posuere, sit."
};

ReactDOM.createRoot(document.getElementById('root')!).render(
  <React.StrictMode>
    <App forum={forumData} />
  </React.StrictMode>
);
